(11, 'BABY TOOTH STATUS', '<p><strong>Tooth Status Chart</strong></p>\n\n<p>For baby teeth, display the following list of categories:</p>\n\n<p>INSTRUCTION: Record the condition of each tooth in the appropriate box.</p>\n\n<p> </p>\n\n<p>1 Sound – never decayed or restored</p>\n\n<p>2 Sound – crown sealed, never decayed or otherwise restored</p>\n\n<p>3 Missing – due to orthodontic treatment</p>\n\n<p>4 Missing – due to trauma</p>\n\n<p>5 Missing – due to caries or periodontal disease</p>\n\n<p>6 Unerupted tooth, congenitally missing or unexposed root</p>\n\n<p>7 Decayed severely</p>\n\n<p>8 Decayed – pit and fissure caries</p>\n\n<p>9 Decayed – smooth surface caries</p>\n\n<p>10 Decayed – both smooth surface and pit and fissure caries</p>\n\n<p>12 Filled with amalgam, no other decay</p>\n\n<p>13 Filled with other material (resin, GIC, inlay, crown), no other decay</p>\n\n<p>14 Filled with amalgam and other material (resin, GIC, inlay, crown), no other decay</p>\n\n<p>15 Filled with amalgam, no other decay, but filling is defective and needs replacement</p>\n\n<p>16 Filled with other material (resin, GIC, inlay, crown) but filling is defective and needs replacement</p>\n\n<p>17 Filled with amalgam and other material (resin, GIC, inlay, crown) but filling is defective and needs replacement</p>\n\n<p>20 Fractured due to trauma</p>\n\n<p>21 Other</p>\n\n<p> </p>\n\n<p>For crowns of adult teeth, display the following list of categories:</p>\n\n<p> </p>\n\n<p>INSTRUCTION: Record the condition of each tooth in the appropriate box.</p>\n\n<p> </p>\n\n<p>1 Sound – never decayed or restored</p>\n\n<p>2 Sound – crown sealed, never decayed or otherwise restored</p>\n\n<p>3 Missing – due to orthodontic treatment</p>\n\n<p>4 Missing – due to trauma</p>\n\n<p>5 Missing – due to caries or periodontal disease</p>\n\n<p>6 Unerupted tooth, congenitally missing or unexposed root</p>\n\n<p>7 Decayed severely</p>\n\n<p>8 Decayed – pit and fissure caries</p>\n\n<p>9 Decayed – smooth surface caries</p>\n\n<p>10 Decayed – both smooth surface and pit and fissure caries</p>\n\n<p>12 Filled with amalgam, no other decay</p>\n\n<p>13 Filled with other material (resin, GIC, inlay, crown), no other decay</p>\n\n<p>14 Filled with amalgam and other material (resin, GIC, inlay, crown), no other decay</p>\n\n<p>15 Filled with amalgam, no other decay, but filling is defective and needs replacement</p>\n\n<p>16 Filled with other material (resin, GIC, inlay, crown) but filling is defective and needs replacement</p>\n\n<p>17 Filled with amalgam and other material (resin, GIC, inlay, crown) but filling is defective and needs replacement</p>\n\n<p>18 Bridge abutment, special crown or veneer</p>\n\n<p>19 Implant</p>\n\n<p>20 Fractured due to trauma</p>\n\n<p>21 Other</p>\n\n<p> </p>\n\n<p>For roots of adult teeth, display the following list of categories:</p>\n\n<p> </p>\n\n<p>INSTRUCTION: Record the condition of each tooth in the appropriate box.</p>\n\n<p> </p>\n\n<p>1 Sound – never decayed or restored</p>\n\n<p>3 Missing – due to orthodontic treatment</p>\n\n<p>4 Missing – due to trauma</p>\n\n<p>5 Missing – due to caries or periodontal disease</p>\n\n<p>6 Unerupted tooth, congenitally missing or unexposed root</p>\n\n<p>7 Decayed severely</p>\n\n<p>11 Decayed – smooth surface caries</p>\n\n<p>12 Filled with amalgam, no other decay</p>\n\n<p>13 Filled with other material (resin, GIC, inlay, crown), no other decay</p>\n\n<p>14 Filled with amalgam and other material (resin, GIC, inlay, crown), no other decay</p>\n\n<p>15 Filled with amalgam, no other decay, but filling is defective and needs replacement</p>\n\n<p>16 Filled with other material (resin, GIC, inlay, crown) but filling is defective and needs replacement</p>\n\n<p>17 Filled with amalgam and other material (resin, GIC, inlay, crown) but filling is defective and needs replacement</p>\n\n<p>19 Implant</p>\n\n<p>20 Fractured due to trauma</p>\n\n<p>21 Other</p>\n\n <table align=\"right\" border=\"1\" >\n <tbod